import React from "react";
import classes from "./Navbar.module.css";
import logo from "../images/logo.png";

const Navbar = () => {
	return (
		<div>
			<div>
				<img src={logo} alt="" />
				<h1>MEAMA</h1>
				<p>Collect</p>
			</div>
		</div>
	);
};

export default Navbar;
